import React from 'react';
import bank1 from '../assets/images/BOB.png';
import bank2 from '../assets/images/boi.png';
import bank3 from '../assets/images/cb.png';

const Services = () => {
  return (
    <section className="services">
      <div className="service-card">
        <img src={bank1} alt="Valuation" />
        <h3>Property Valuation</h3>
        <p>Expert valuation reports for residential, commercial, and industrial properties.</p>
      </div>
      <div className="service-card">
        <img src={bank2} alt="Engineering" />
        <h3>Chartered Engineering Services</h3>
        <p>Authorized certifications for machinery import/export and technical documentation.</p>
      </div>
      <div className="service-card">
        <img src={bank3} alt="Loan Reports" />
        <h3>Loan & Project Reports</h3>
        <p>Comprehensive financial and project feasibility reports for bank loans.</p>
      </div>
    </section>
  );
};

export default Services;
